import React from "react";
import Person from "./Person/Person";

export default (props) => {
  const persons = props.persons.map((person, index) => {
    return <Person key = {index} age = {person.age} name = {person.name} onClick = {(event) => props.clicked(index)} changed = {(event) => props.changed(event, person.id)}></Person>
    }
  );
  return persons;
};
